import React from 'react';
import Post from '../MyPosts/Post';
import classes from '../../../css/Profile/MyPosts/MyPost.module.css';

const MyPosts = () => {

    let postsData = [
        {id: 1, message: 'Hi, how are u?', likes: '11'},
        {id: 2, message: 'Hi, everybody!', likes: '30'},
        {id: 3, message: 'OK. And u?'}
    ]

    return (
        <div className={classes.entries}>
            <p>My posts</p>
            <div>
                <form>
                    <textarea></textarea>
                    <button>Отправить</button>
                </form>
            </div>
            <Post message={postsData[0].message} likes={postsData[0].likes} />
            <Post message={postsData[1].message} likes="30" />
        </div>
    );
}

export default MyPosts;
